-- Create database if it does not exist
CREATE DATABASE IF NOT EXISTS `aasservice`;
USE `aasservice`;

-- Table structure for table `aas`
CREATE TABLE IF NOT EXISTS `aas` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `asset_id` varchar(255) DEFAULT NULL,
  `creation_date` datetime(6) DEFAULT NULL,
  `last_edit_date` datetime(6) DEFAULT NULL,
  `sender` varchar(255) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `upload` longblob DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- Table structure for table `api_keys`
CREATE TABLE IF NOT EXISTS `api_keys` (
  `owner` varchar(255) NOT NULL,
  `key_hash` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`owner`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

